gPV(){return'Privacy Policy\n\nLast updated: February 2026\n\nFling Arrows ("the Game") is a casual puzzle game developed for mobile devices. Your privacy is important to us. This Privacy Policy explains what information we collect, how we use it, and your rights.\n\n1. Information We Collect\n\nThe Game collects minimal data necessary for operation:\n- Game progress (levels completed, stars earned) stored locally on your device\n- Settings preferences (language, sound, haptics) stored locally on your device\n- Anonymous usage analytics (crash reports, session duration) to improve game quality\n\nWe do not collect personal information such as your name, email address, phone number, or precise location.\n\n2. How We Use Information\n\nLocally stored data is used solely to:\n- Save and restore your game progress\n- Remember your preferred settings\n- Provide a seamless gameplay experience\n\nAnonymous analytics data is used to:\n- Identify and fix bugs and crashes\n- Understand which levels may need balancing\n- Improve overall game performance\n\n3. Third-Party Services\n\nThe Game may use the following third-party services:\n- Advertising networks to display ads (free version)\n- Analytics providers for anonymous crash reporting\n\nThese services may collect anonymized data according to their own privacy policies. We encourage you to review their policies.\n\n4. Data Storage and Security\n\nAll game progress and settings are stored locally on your device. We do not maintain external databases with your personal information. Anonymous analytics data is transmitted securely using industry-standard encryption.\n\n5. Children\'s Privacy\n\nThe Game does not knowingly collect personal information from children under 13. The Game contains no features that require personal data input. If you believe a child has provided personal information, please contact us at flingarrows@example.com.\n\n6. Your Rights\n\nYou can:\n- Delete all game data by uninstalling the Game or clearing app data\n- Opt out of analytics through your device settings\n- Contact us with any privacy concerns\n\n7. Changes to This Policy\n\nWe may update this Privacy Policy from time to time. Changes will be reflected in the "Last updated" date above.\n\n8. Contact Us\n\nIf you have questions about this Privacy Policy, contact us at flingarrows@example.com.'},
